import Mood from "./Component/Mood";
import Random from "./Component/Random";
import Giphy from "./Component/Giphy";

function App() {
  const fetchpost = async () => {
    const uri =
      "https://api.giphy.com/v1/gifs/search?api_key=iInrXoDTJnWBPH41u1Pnfc09eGy7z29l&q=mood&limit=25&offset=0&rating=g&lang=en";
  };

  return (
    <React.Fragment>
      <div className="container">
        <h2>Giphy</h2>
        <Mood></Mood>
        <Random></Random>
        <Giphy></Giphy>
      </div>
    </React.Fragment>
  );
}

export default App;
